import React from 'react';
import ReactDOM from 'react-dom';

const TodoList = () => {
    return(
    <ul>
        <li>Learn React</li>
        <li>Build Awesome App</li>
    </ul>
    )
}

const AppHeader = () =>{
    return(
        <h1>My Todo List</h1>
    )
}

const SearchPanel = () => {
    return(
        <input placeholder="search" />
    )

}

const isLoggedIn = true;
const loginBox = <span>Log in please</span>

const App = () => {
    return(
        <div>
            { loginBox }
            <AppHeader/>
            <SearchPanel />
            <TodoList />
        </div>
    )
}


    ReactDOM.render( <App />,
        document.getElementById('root'));
